import React from 'react';
import './AboutMe2.css';

function AboutMe2() {
  const isMobile = /Mobi/.test(navigator.userAgent);
  window.onscroll = () => {
    if (window.innerHeight + window.scrollY+500 >= document.body.offsetHeight) {
        // Change color to green
        h2.style.animationPlayState = 'running'}
        else{
            document.querySelector('.ABMC').style.animationPlayState === 'paused';
        }
  }

  if(isMobile){
    return (
      <div>
        none
      </div>
    );
  }
  return (

    <div className="ABMC">
        <h1>About Me</h1>
        <div>
            <h2>Education: University of Florida</h2>
        </div>
        <div>
            <h2>Bachelors in Computer </h2>
        </div>

    </div>
  );
}

export default AboutMe2;
